// Navbar.jsx
import React, { useState } from "react";
import { Link } from "react-router-dom";
import ServiceCard from "./ServiceCard"; // adjust path if needed

import ModularKitchen from "../images/Services/modularkitchen.jpg";
import FalseCeiling from "../images/Services/falseCeiling.jpg";
import TVUnit from "../images/Services/Tvunits.jpg";
import Wardrobe from "../images/Services/wardrobs.jpg";
import OfficeSpace from "../images/Services/officespaces.jpg";
import Bedroom from "../images/Services/bedroom.jpg";
import ExternalArchitecture from "../images/Services/ExternalArc.jpg";
import "./Navbar.css";

// Service data
const services = [
  { title: "Residential Construction", description: "Custom homes, apartments, and villas built to your specifications.", image: Bedroom },
  { title: "Commercial Construction", description: "Office buildings, retail spaces, and commercial complexes.", image: OfficeSpace },
  { title: "Industrial Projects", description: "Factories, warehouses, and large-scale industrial facilities.", image: ExternalArchitecture },
  { title: "Renovation & Remodeling", description: "Upgrades, expansions, and modernizations for existing structures.", image: Wardrobe },
  { title: "Project Management", description: "End-to-end project management for seamless execution.", image: TVUnit },
  { title: "Modular Kitchen", description: "Custom-designed modular kitchens with modern fittings and finishes.", image: ModularKitchen },
  { title: "False Ceiling", description: "Modern false ceiling designs for enhanced aesthetics and lighting.", image: FalseCeiling },
  { title: "TV Units", description: "Elegant and functional TV units tailored to your living room aesthetics.", image: TVUnit },
  { title: "Wardrobes", description: "Spacious and customizable wardrobes for your clothing and accessories.", image: Wardrobe },
  { title: "Office Spaces", description: "Modern office interiors designed for productivity and professionalism.", image: OfficeSpace },
  { title: "Bedrooms", description: "Cozy and stylish bedroom designs for restful nights.", image: Bedroom },
  { title: "External Architecture", description: "Striking external architectural solutions for curb appeal.", image: ExternalArchitecture },
];

function Navbar() {
  const [menuOpen, setMenuOpen] = useState(false);
  const [servicesOpen, setServicesOpen] = useState(false);

  const handleMenuToggle = () => setMenuOpen(!menuOpen);
  const toggleServices = () => setServicesOpen(!servicesOpen);

  return (
    <nav className="custom-navbar">
      <div className="nav-container">
        <div className="brand">Gajulapalli Infra</div>

        <div className="nav-links">
          <Link to="/" className="nav-item">Home</Link>
          <Link to="/about" className="nav-item">About</Link>

          <div
            className="nav-item services-dropdown-parent"
            onMouseEnter={() => setServicesOpen(true)}
            onMouseLeave={() => setServicesOpen(false)}
          >
            <span className="nav-item">Services ▾</span>
            {servicesOpen && (
              <div className="services-dropdown">
                {services.map((service, idx) => (
                  <div key={idx} className="dropdown-service-card">
                    <ServiceCard
                      title={service.title}
                      description={service.description}
                      image={service.image}
                      index={idx}
                    />
                  </div>
                ))}
              </div>
            )}
          </div>

          <Link to="/projects" className="nav-item">Projects</Link>
          <Link to="/contact" className="nav-item">Contact</Link>
        </div>

        <button className="hamburger" onClick={handleMenuToggle}>
          <svg viewBox="0 0 24 24" stroke="currentColor" fill="none" strokeWidth="2" className="hamburger-icon">
            <path d="M4 6h16M4 12h16M4 18h16" />
          </svg>
        </button>
      </div>

      {menuOpen && (
        <div className="mobile-menu">
          <Link to="/" className="mobile-item" onClick={() => setMenuOpen(false)}>Home</Link>
          <Link to="/about" className="mobile-item" onClick={() => setMenuOpen(false)}>About</Link>
          <Link to="/services" className="mobile-item" onClick={() => setMenuOpen(false)}>Services</Link>
          <Link to="/projects" className="mobile-item" onClick={() => setMenuOpen(false)}>Projects</Link>
          <Link to="/contact" className="mobile-item" onClick={() => setMenuOpen(false)}>Contact</Link>
        </div>
      )}
    </nav>
  );
}

export default Navbar;
